import React from "react";
import "../css/header.scss";

const Header = () => {
  return (
    <div className="header">
      <h1 className="header__title">Nicolas Mero</h1>
      <div className="navbar">
        <a href="">
          <h2>Home</h2>
        </a>
      </div>
    </div>
  );
};

export default Header;
